import React from "react";
import { Route, Routes } from "react-router-dom";

function WomenRoutes() {
  return (
    <Routes>
      <Route index element={<WomenHome />} />
      <Route path="coats-jackets" element={<ProductLanding />} />
    </Routes>
  );
}

export default WomenRoutes;
